// src/pages/RideSearch.js
import React from 'react';
import Navbar from '../components/Navbar';

function RideSearch() {
  return (
    <div>
      <Navbar />
      <h2>Find Rides</h2>
      {/* Ride search form and results */}
    </div>
  );
}

export default RideSearch;
